import React from "react";

function DashboardPage() {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1 id="">Welcome to Dashboard!</h1>
      <p>You are successfully logged in.</p>
    </div>
  );
}

export default DashboardPage;
